const UpdateSeller = async event => {

    console.log("PICOOOO", event)

    const myHeaders = new Headers();
	myHeaders.append('Content-Type', 'application/json');

    const data = {

            "id_cliente": "amazon|amzn1.account.AHG4S7Q35E4KB5DZGK6BENXDZ6IQ",
            "key2": "value2",
            "key3": "value3"  
    }

	const raw = JSON.stringify(data);

	const requestOptions = {
		method: 'POST',
		headers: myHeaders,
		body: raw
	};

	fetch('https://fl8vvup0y0.execute-api.us-east-1.amazonaws.com/dev/updateseller', requestOptions)
		.then(response => response.json())
		.then(result => console.log(result))
		.catch(error => console.log('error', error));

	return '';
};

export default UpdateSeller;
